import React from "react";
import { createNativeStackNavigator } from "@react-navigation/native-stack";

import SecondScreen from "../screens/SecondScreen";
import MainTabs from "./MainTabs";
import Detail from "../screens/Detail"
import Pedreiros from "../screens/Serviços/Pedreiros/Pedreiros";
import Designers from "../screens/Serviços/Designers";
import Pintores from "../screens/Serviços/Pintores";
import Cuidadores from "../screens/Serviços/Cuidadores";

const MainStack = createNativeStackNavigator();
const Main = () => {
  return (
    <MainStack.Navigator
      screenOptions={{
        headerShown: false,
      }}
    >
      <MainStack.Screen name="MainTabs" component={MainTabs} />
      <MainStack.Screen name="SecondScreen" component={SecondScreen} />
      <MainStack.Screen name="Detail" component={Detail} />
      <MainStack.Screen name="Pedreiros" component={Pedreiros} />
      <MainStack.Screen name="Designers" component={Designers} />
      <MainStack.Screen name="Pintores" component={Pintores} />
      <MainStack.Screen name="Cuidadores" component={Cuidadores} />
      <MainStack.Screen name="SecondScreen" component={SecondScreen} />
      <MainStack.Screen name="SecondScreen" component={SecondScreen} />
    </MainStack.Navigator>
  );
};

export default Main;
